window.bookSummaryJSON = "<p>WILLOW</p> <p>Now that I’ve found my soulmate, life has never been better…But of course as a Cold Tethered couple, happiness doesn’t always last.</p> <p>Soon, my nightmares are being haunted, my future threatened, and my bond with Caz could slip right through my fingers.</p> <p>I hate that it’s come to this, but we’re now facing the biggest fight of our lives.</p> <p>Limits are tested.</p> <p>Blood is shed.</p> <p>Hearts are shattered.</p> <p>My only hope is that, through it all, everyone I love makes it out alive.</p> <p>CAZ</p> <p>There is nothing I want more than to give Willow the life she deserves.</p> <p>Unfortunately, that becomes hard to do when a wicked being wants to destroy me, my tethered bond, and everyone I love.</p> <p>Soon, territories are being threatened, family members are attacked, and betrayals come from all directions.</p> <p>And according to two of the Regals, I am the only person powerful enough to save the fate of our world.</p> <p>No matter how much I struggle to control the power inside me, there is one thing I must remember: if I give up, I will lose everything.</p> <p>Lethal Souls is the third and final book of the Tether Trilogy.</p> <p>Trilogy Listening Order:</p> <p>Vicious Bonds</p> <p>Wicked Ties</p> <p>Lethal Souls</p>"; 
